        $('#txt-search').keyup(function() {
            var searchField = $(this).val();
            if (searchField === '') {
                $('#filter-records').html('');
                return;
            }

            var regex = new RegExp(searchField, "i");
            var output = '<div class="row">';
            var count = 1;
            $.each(data, function(key, val) {
                if ((val.code_clasf.search(regex) != -1) || (val.codigo_mef.search(regex) != -1)) {
                    output += '<div class="col-md-6 well">';
                    output += '<div class="col-md-3"><img class="img-responsive" src="https://cdn2.iconfinder.com/data/icons/science-and-education-4/64/Clipboard-512.png" alt="'+ val.año +'" /></div>';
                    output += '<div class="col-md-7">';
                    output += '<h5>' + val.nota + '</h5>';
                    output += '<p>' + val.Habilitadora + '</p>'
                    output += '<p>' + val.Habilitada + '</p>'
                    output += '<p>' + val.año + '</p>'
                    output += '</div>';
                    output += '</div>';
                    if (count % 2 == 0) {
                        output += '</div><div class="row">'
                    }
                    count++;
                }
            });
            output += '</div>';
            $('#filter-records').html(output);
        });
    });
